import React, { Component } from 'react'

export class Game extends Component {
    constructor(props) {
        super(props)

        this.state = {
            speed: 0,
            level:1
        }
    }

    render() {
        const { correctWordList, wrongWordList } = this.props
        let nextLevel = this.props.level + 1
        return (
            <div>

                {correctWordList}
                {wrongWordList}

                <button onClick={() => this.props.handleLevel(nextLevel)}>Next Level</button>

            </div>
        )
    }
}

export default Game
